import React from "react";
import { connect } from "react-redux";
import { Table } from "reactstrap";

const mapStateToProps = (state) => {
  return {
    getUserDetail: state.users.getUserDetail,
    errorUserDetail: state.users.errorUserDetail,
  };
};

const DetailComponent = (props) => {
  return (
    <Table striped>
      <tbody>
        <tr>
          <td width="200">Logical UID</td>
          <td width="10">:</td>
          <td>{props.getUserDetail.logical_uid}</td>
        </tr>
        <tr>
          <td width="200">Nama</td>
          <td width="10">:</td>
          <td>{props.getUserDetail.name}</td>
        </tr>
        <tr>
          <td width="200">Jumlah</td>
          <td width="10">:</td>
          <td>{props.getUserDetail.qty}</td>
        </tr>

      </tbody>
    </Table>
  );
};

export default connect(mapStateToProps, null)(DetailComponent);
